import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image, ImageBackground } from 'react-native';
import Icon from './Icon'
import { useFonts } from 'expo-font'
import { transparent } from 'react-native-paper/lib/typescript/styles/themes/v2/colors';



export default function App() {
  const [fontsLoaded] = useFonts({
    'Allison': require('./assets/fonts/Allison.ttf'),
  })
  const styles = StyleSheet.create({
    container: {
      flex: 1,
    },
    image: {
      flex: 1,
      justifyContent: 'center',
    },
    text: {
      color: 'white',
      fontSize: 42,
      lineHeight: 84,
      fontWeight: 'bold',
      textAlign: 'center',
      backgroundColor: '#000000c0',
    },
  })
  

  return (
    <View style={styles.container}>
      <StatusBar style="auto" />
      {/* <Image source={Icon.logo} style={{width: 100, height: 100}} /> */}
      <Text style={{ fontFamily: 'Allison', fontSize: 80, zIndex: 3, elevation: 3, textAlign: 'center', backgroundColor:transparent }}>FoodFinder</Text>
      <ImageBackground source="https://14thlane.ro/files/pages/1/OurStory2.webp" resizeMode="cover" style={styles.image}></ImageBackground>

    </View>
    
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  image: {
    flex: 1,
    justifyContent: 'center',
  },
  text: {
    color: 'white',
    fontSize: 42,
    lineHeight: 84,
    fontWeight: 'bold',
    textAlign: 'center',
    backgroundColor: '#000000c0',
  },
});
